import React from "react";

const ProductCard = ({ product }) => {
  return (
    <div
      className="flex flex-col gap-3 w-[300px] h-[500px] rounded-md items-center
    shadow-2xl overflow-hidden"
    >
      <img
        src={product.image}
        className="w-[300px] h-[250px]"
        alt="product"
      />
      <h4 className="text-orange-600 text-[24px] font-semibold">
        ${product.price}
      </h4>
      <h4 className="text-black truncate text-[24px] font-semibold">
        {product.name}
      </h4>
    </div>
  );
};

export default ProductCard;
